import React from "react";
import ToyDisplay from "./components/toysDisplay";

function BodyWrapper() {
  return (
    <div className="container">
        {toys.map(toy => 
          <ToyDisplay 
          image={toy.image}
          cost={toy.cost}
          />
        )}
        
        <ToyDisplay />    
    </div> 
  );
}

export default BodyWrapper;
